tasks.text_content:
realizar cancelamento de pedidos no venda balcão que estejam em situação de Liberado.
Formulário da solicitação.
https://forms.office.com/Pages/DesignPageV2.aspx?prevorigin=shell&origin=NeoPortalPage&subpage=design&id=uLYeWStNoEOIerl_-nP6MJaV5g3MRVBJtLvQcWIxK2ZUODk5TEhLMU9FWE9VN1FHVEVOQlYyRElPRi4u&analysis=true&topview=SurveyResults&qid=r1cbe42c68e724f44b1e99c9c19e3dac4&ridx=5

1 - Baixar Query para identificar os pedidos que estejam liberados.
2 - Selecionar os pedidos;
3 - Abrir Consinco;
4 - Abrir aplicação Venda Balcão;
5 - Selecionar e buscar o pedido para cancelamento;
6 - Realizar o cancelamento do Pedido;

Tempo de economia entre 2 a 4 horas semanais.

